import 'package:flutter/material.dart';

void main() {
  runApp(MyApp());
}

class MyApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      title: 'Login & Game Top Up',
      theme: ThemeData.dark().copyWith(
        inputDecorationTheme: InputDecorationTheme(
          labelStyle: TextStyle(color: Colors.white), // Change label color to white
          enabledBorder: OutlineInputBorder(
            borderSide: BorderSide(color: Colors.white), // Change border color to white
          ),
          focusedBorder: OutlineInputBorder(
            borderSide: BorderSide(color: Colors.white), // Change focused border color to white
          ),
        ),
        elevatedButtonTheme: ElevatedButtonThemeData(
          style: ElevatedButton.styleFrom(
            backgroundColor: Colors.white, // Change button color to white
            foregroundColor: Colors.black, // Change text color to black
          ),
        ),
      ),
      initialRoute: '/',
      routes: {
        '/': (context) => LoginPage(),
        '/game_top_up': (context) => GameTopUpHomePage(),
      },
    );
  }
}

class LoginPage extends StatefulWidget {
  @override
  _LoginPageState createState() => _LoginPageState();
}

class _LoginPageState extends State<LoginPage> {
  final _formKey = GlobalKey<FormState>();
  final _usernameController = TextEditingController();
  final _passwordController = TextEditingController();

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Login'),
      ),
      backgroundColor: Color.fromRGBO(0, 0, 0, 1), // Set background color to black
      body: Center(
        child: Container(
          padding: EdgeInsets.all(20.0),
          child: Form(
            key: _formKey,
            child: Column(
              mainAxisAlignment: MainAxisAlignment.center,
              children: <Widget>[
                // Add your logo here
                Image.asset(
                  'assets/logo.png', // Path to your logo asset
                  height: 150, // Adjust the height as needed
                ),
                SizedBox(height: 30.0), // Add spacing between logo and form fields
                TextFormField(
                  controller: _usernameController,
                  decoration: InputDecoration(
                    labelText: 'Username',
                  ),
                  style: TextStyle(color: Colors.white), // Change text color to white
                  validator: (value) {
                    if (value == null || value.isEmpty) {
                      return 'Username tidak boleh kosong';
                    }
                    return null;
                  },
                ),
                SizedBox(height: 20.0),
                TextFormField(
                  controller: _passwordController,
                  obscureText: true,
                  decoration: InputDecoration(
                    labelText: 'Password',
                  ),
                  style: TextStyle(color: Colors.white), // Change text color to white
                  validator: (value) {
                    if (value == null || value.isEmpty) {
                      return 'Password tidak boleh kosong';
                    }
                    return null;
                  },
                ),
                SizedBox(height: 30.0),
                ElevatedButton(
                  onPressed: () {
                    if (_formKey.currentState!.validate()) {
                      // Handle login logic here
                      Navigator.pushNamed(context, '/game_top_up');
                      print('Username: ${_usernameController.text}');
                      print('Password: ${_passwordController.text}');
                    }
                  },
                  child: Text('Masuk'),
                ),
                SizedBox(height: 30.0), // Add spacing before social login options
                Text('atau Login dengan akun'),
                SizedBox(height: 20.0), // Add spacing between text and social buttons
                Row(
                  mainAxisAlignment: MainAxisAlignment.center,
                  children: [
                    _buildSocialLoginButton('assets/logo_google.png'),
                    SizedBox(width: 20.0),
                    _buildSocialLoginButton('assets/logo_facebook.png'),
                    SizedBox(width: 20.0),
                    _buildSocialLoginButton('assets/logo_apple.png'),
                  ],
                ),
              ],
            ),
          ),
        ),
      ),
    );
  }

  Widget _buildSocialLoginButton(String assetPath) {
    return GestureDetector(
      onTap: () {
        // Handle social login logic here
      },
      child: CircleAvatar(
        radius: 25.0, // Adjust the size of the button
        backgroundImage: AssetImage(assetPath),
        backgroundColor: Colors.transparent,
      ),
    );
  }
}


class GameTopUpHomePage extends StatefulWidget {
  @override
