      'image':
          'data:image/jpeg;base64,'
    },
    {
      'name': 'Clash Of Clans',
      'category': 'Strategy',
      'image':
          'data:image/jpeg;base64,'
    },
    {
      'name': 'PUBG',
      'category': 'Action',
