    },
    {
      'name': 'Toram Online',
      'category': 'Strategy',
      'image':
          'data:image/jpeg;base64,'
    },
  ];

  List<Map<String, String>> get filteredGames {
    List<Map<String, String>> filteredList = games;

    if (selectedFilter != 'All') {
      filteredList = filteredList
          .where((game) => game['category'] == selectedFilter)
          .toList();
    }

    if (searchQuery.isNotEmpty) {
      filteredList = filteredList
          .where((game) =>
              game['name']!.toLowerCase().contains(searchQuery.toLowerCase()))
          .toList();
    }

    return filteredList;
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Top Up Game'),
        actions: [
          DropdownButton<String>(
            value: selectedFilter,
            dropdownColor:
                Colors.black, // Set dropdown background color to black
            onChanged: (String? newValue) {
              setState(() {
                selectedFilter = newValue!;
              });
            },
            items: <String>[
              'All',
              'RPG',
              'Action',
              'Moba',
              'Strategy'
            ].map<DropdownMenuItem<String>>((String value) {
              return DropdownMenuItem<String>(
                value: value,
                child: Text(value,
                    style: TextStyle(
                        color: Colors.white)), // Set text color to white
              );
            }).toList(),
          ),
        ],
      ),
      body: Container(
        color: Colors.black, // Set background color to black
        child: Column(
          children: [
            Padding(
              padding: const EdgeInsets.all(8.0),
              child: TextField(
                onChanged: (value) {
                  setState(() {
                    searchQuery = value;
                  });
                },
                style:
                    TextStyle(color: Colors.white), // Set text color to white
                decoration: InputDecoration(
                  hintText: 'Search games...',
                  hintStyle: TextStyle(
                      color: Colors.grey), // Set hint text color to grey
                  prefixIcon: Icon(Icons.search, color: Colors.grey),
                  enabledBorder: OutlineInputBorder(
                    borderSide: BorderSide(color: Colors.grey),
                    borderRadius: BorderRadius.all(Radius.circular(12.0)),
                  ),
                  focusedBorder: OutlineInputBorder(
                    borderSide: BorderSide(color: Colors.white),
                    borderRadius: BorderRadius.all(Radius.circular(12.0)),
                  ),
                ),
              ),
            ),
            Expanded(
              child: ListView.builder(
                itemCount: filteredGames.length,
                itemBuilder: (context, index) {
                  return ListTile(
                    leading: Image.network(
                        filteredGames[index]['image']!), // Display game image
                    title: Text(filteredGames[index]['name']!,
                        style: TextStyle(
                            color: Colors.white)), // Set text color to white
                    subtitle: Text(filteredGames[index]['category']!,
                        style: TextStyle(
                            color: Colors.grey)), // Set text color to grey
                    trailing: ElevatedButton(
                      onPressed: () {
                        // Add your top-up logic here
                        print('Top Up ${filteredGames[index]['name']}');
                      },
                      child: Text('Top Up'),
                    ),
                  );
                },
              ),
            ),
          ],
        ),
      ),
      bottomNavigationBar: BottomNavigationBar(
        backgroundColor:
            Colors.black, // Set bottom navigation bar color to black
        selectedItemColor: Colors.white, // Set selected item color to white
        unselectedItemColor: Colors.grey, // Set unselected item color to grey
